import React from 'react';


export default function Main ({ match }){
    return(
        <div className="main-container">
            <img src="https://logosmarcas.net/wp-content/uploads/2020/04/Huawei-Logo.png" alt="logo"/>
            <ul>
                <li>
                    <img src="https://platform-lookaside.fbsbx.com/platform/profilepic/?asid=249713433458038&height=50&width=50&ext=1619894564&hash=AeRBt_zeewbD3XoB8_8" alt="user" />
                    <footer>
                        <strong>Jadyel Sousa Gomes</strong>
                    </footer>
                </li>
            </ul>
        </div>
    )

}
